(function(){"use strict";function o(){document.querySelectorAll("img.franchiseicon").forEach(e=>{const c=e.src.replace("_icon","");if(e.src!==c){const n=new Image;n.src=c,n.onload=()=>{e.style.transition="opacity 0.2s ease-in-out",e.style.opacity="0",setTimeout(()=>{e.src=c,e.style.opacity="1"},150)}}})}document.addEventListener("DOMContentLoaded",()=>{document.querySelector("img.franchiseicon")&&o()})})();
